import axios from 'axios';
import { faker } from '@faker-js/faker';

const API_KEY = process.env.INTERNAL_API_KEY;
const API_URL = 'https://ser.carsen.dev/new_token';

async function createRandomToken() {
  try {
    const sym = faker.finance.currencyCode();
    const username = faker.internet.username();
    // Generate random token data
    const tokenData = {
      name: sym + " Token", // Keep name reasonably short
      symbol: sym, // 3-4 letter symbol
      description: "ser, test token description, ser",
      website: "https://serlaunchalot.com",
      twitter: "https://x.com/serlaunchalot",
      telegram: "https://t.me/serlaunchalot",
      // base64 image
      image: 'data:image/png;base64,',
      xusername: username,
      xname: username,
      xurl: `https://x.com/${username}/89fsda8hf9ftweetTeST`,
      xavatarurl: `https://x.com/${username}/imgtest.png`,
      xtext: `This is a test tweet text for ${username}`
    };

    // Make API request
    const response = await axios.post(API_URL, tokenData, {
      headers: {
        'x-api-key': API_KEY,
        'Content-Type': 'application/json'
      }
    });

    console.log('Token created successfully:', response.data);
  } catch (error) {
    console.error('Error creating token:', error.response?.data || error.message);
  }
}

// Create a token every 30 seconds
setInterval(createRandomToken, 30000);

// Create first token immediately
createRandomToken();
